@ghostfashion have recently expanded their sizes up to a size 20 / XXXL, an exciting step towards better size inclusion for the British brand 💕 Here I’m styling up their gorgeous pink satin shirt, a piece from their Archive collection 💙 I would say it’s worth while trying the pieces on if you are a size 22 or perhaps a 24 like myself. They are well known for their bias cut styles which often have more ease and fit flexibility due the way the fabric is cut, making those pieces more likely to fit a bigger size too. 

I want to caveat this by saying that I do hope they push to expand their sizes further, but I like to celebrate any progress a brand makes. Although I absolutely don’t believe that you should squeeze yourself into a size just to wear a brand, I am open to trying clothes in sizes smaller than my own just in case I like the fit that way. 

Shirt is a pr sample from @ghostfashion via @vargltd

